description:
The point shape file shows the number of defaults and foreclosures by zipcode in the Devner HOC region of all home loans originated between Feb, 2007 to Feb 2009 that are backed by FHA home insurance.

HUD (Housing and Urban Devp) has four regional centers located in Atlanta, Denver, Philadelphia and Santa Ana.

Look for defaults and foreclosure data for other regions elsewhere on Finder! using key word &quot;FHA&quot; or &quot;HOC&quot;
